import "./ProjectTile.css"
import v3 from "../Images/v3.png";

function ProjectTile() {
    return (
        <div class="project-tile">
            <a href="<?php the_permalink();?>" target="_blank">
                <img src={v3}/>
                <p>the_title</p>
            </a>  
        </div>
    )
}

export default ProjectTile;
